import React, { Component } from 'react';
import songs from "../data/songs.json";

class songList extends Component {
    render() {
        return (
            <div>
                songs.items.map((item, i ) => {

                    <div key={i}>
                        <div>
                            item.album.name
                        </div>
                    </div>

                })
            </div>
        );
    }
}
export default songList;
